import {Row,Col,Button} from 'reactstrap';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
class Login extends Component {
    state = {  }
    render() { 
        return (
            <Row>
                <Col>
                    <Button>
                        Press to Login
                        <FontAwesomeIcon icon={["fal","dice-d20"]}/>
                    </Button>
                </Col>
            </Row>
        );
    }
}
 
export default Login;
